                const flakeTime = 320; //amount of time (in milliseconds) between creating snowflakes
                const flakeSpeed = 0.1875; //horizontal speed of the flakes
                const flakeGravity = 0.25; //vertical speed of the flakes

                //generate snowflakes
                function makeFlake() {
                    //create snowflake in a containing div so that the flake can rotate without affecting origin used in translation of the image
                    let flakeContainer = document.createElement('div');
                    flakeContainer.classList.add('snowflake-container');

                    //create the snowflake itself
                    let flake = document.createElement('img');
                    flake.src = flakeImage;
                    flake.classList.add("snowflake");
                    //add flake to its container
                    flakeContainer.append(flake);

                    //give snowflake a random initial position horizontally
                    flakeContainer.style.left = Math.floor(Math.random() * document.documentElement.clientWidth) + 'px';
                    //snowflakes start at the top of the page
                    flakeContainer.style.top = '0px';

                    //give flakes a random direction that they will move in upon initial generation
                    const directionSwitch = Math.random();
                    let direction;
                    if(directionSwitch < 0.35)
                    {
                        direction = -1;
                    }
                    else if (directionSwitch < 0.65)
                    {
                        direction = 0;
                    }
                    else {
                        direction = 1;
                    }
                    flakeContainer.dataset.direction = direction;

                    //give flakes a random speed at which they will move horizontally (if at all)
                    flakeContainer.dataset.speed = Math.random() * 2;
                    
                    //add flake to both the array of live flakes and the page itself
                    flakes.push(flakeContainer);
                    document.getElementsByTagName('body')[0].append(flakeContainer);
                }

                let prev; //keep track of timestamp of previous animation frame

                function anim(timestamp) {
                    //ensure constant rate of movement based on elapsed time from previous frame
                    let elapsed;
                    if (prev !== undefined)
                    {
                        elapsed = timestamp - prev;
                    } 
                    else {
                        elapsed = 1;
                    }

                    for (const elem of flakes) {
                        //first cull any off-screen flakes
                        const rect = elem.getBoundingClientRect();
                        if (rect.top > document.documentElement.clientHeight || rect.right < 0 || rect.left > document.documentElement.clientWidth)
                        {
                            elem.remove();
                            flakes = flakes.filter(item => item !== elem);
                            break;
                        }

                        //move the flake containers
                        const grav = elapsed * flakeGravity;
                        const dist = elapsed * flakeSpeed * elem.dataset.speed * elem.dataset.direction;
                        elem.style.transform = new DOMMatrix(getComputedStyle(elem).transform).translateSelf(dist, grav);
                        //rotate the flake itself
                        elem.firstChild.style.transform = new DOMMatrix(getComputedStyle(elem.firstChild).transform).rotateSelf(0,5);
                    }
                    //update with timestamp of this frame and await new frame
                    prev = timestamp;
                    requestAnimationFrame(anim);
                }

                //start flake generator and animation loop
                document.addEventListener("DOMContentLoaded", function() {
                    window.maker = window.setInterval(makeFlake, flakeTime);
                    //ensure that flakes don't keep being generated while user is in another browser tab
                    document.addEventListener('visibilitychange', function() {
                        if(document.hidden)
                        {
                            window.clearInterval(window.maker);
                        }
                        else {
                            window.maker = window.setInterval(makeFlake, flakeTime);
                        }
                    });
                    requestAnimationFrame(anim);
                });
            }());
        </script>
    </body>
</html>
